CREATE TABLE `sj_questions` (
  `question_id` int(11) NOT NULL AUTO_INCREMENT,
  `disabled` tinyint(1) NOT NULL DEFAULT '0',
  `reference_id` int(11) NOT NULL COMMENT 'for sub question to refer to each other',
  `sub_question` varchar(2) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT 'A',
  `source` int(11) NOT NULL DEFAULT '0' COMMENT '0 = system, int = user submitted',
  `question_text` varchar(4096) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `school_id` int(11) DEFAULT NULL,
  `CASA` varchar(5) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `level_id` int(11) NOT NULL,
  `topic_id` int(11) NOT NULL,
  `question_type_id` int(11) NOT NULL,
  `year` year(4) NOT NULL,
  `insert_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `difficulty` float NOT NULL,
  `graphical` varchar(64) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `answer_type_id` int(11) DEFAULT '1',
  PRIMARY KEY (`question_id`),
  KEY `question_id` (`question_id`),
  KEY `level_id` (`level_id`),
  KEY `topic_id` (`topic_id`),
  KEY `question_type_id` (`question_type_id`),
  KEY `school_id` (`school_id`),
  CONSTRAINT `sj_questions_ibfk_2` FOREIGN KEY (`level_id`) REFERENCES `sj_levels` (`level_id`),
  CONSTRAINT `sj_questions_ibfk_3` FOREIGN KEY (`topic_id`) REFERENCES `sj_categories` (`id`),
  CONSTRAINT `sj_questions_ibfk_4` FOREIGN KEY (`question_type_id`) REFERENCES `sj_question_type` (`question_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8983 DEFAULT CHARSET=utf8;
